import React, { useContext } from "react";
import { GlobalContext } from "../context/GlobalState";

export const Feed = () => {
  const { post } = useContext(GlobalContext);
  console.log(post);

  return (
    <div className="feed">
      {post.map(postObject => {
        return (<p key={postObject.id}>
            {postObject.user}<br/><br/>
            {postObject.text}<br/><br/>
            {postObject.date.getHours()}:{postObject.date.getMinutes()} - {postObject.date.getDay()}.{postObject.date.getMonth()}.{postObject.date.getFullYear()}<br/><br/><hr/>
        </p>)
      })}
    </div>
  );
};
